import styles from "./AppHeader.module.css";
// import { data } from "../../utils/data";
import {
  BurgerIcon,
  ProfileIcon,
  ListIcon,
  Logo,
} from "@ya.praktikum/react-developer-burger-ui-components";

const NavLink = ({ isActive, name, children }) => {
  return (
    <li className={`${styles.header__navLink} pl-5 pr-5`}>
      {children}
      <p
        className={` ${
          !isActive && "text_color_inactive"
        } pl-2 text text_type_main-default`}
      >
        {name}
      </p>
    </li>
  );
};

const NavLinks = () => {
  return (
    <ul className={styles.header__navLinks}>
      <NavLink name="Констурктор" isActive={true}>
        <BurgerIcon type="primary" />
      </NavLink>
      <NavLink name="Констурктор" isActive={false}>
        <ListIcon type="secondary" />
      </NavLink>
    </ul>
  );
};

function AppHeader() {
  return (
    <header className={`${styles.header}`}>
      <nav className={`${styles.header__container}`}>
        <NavLinks />
        <Logo />
      </nav>
    </header>
  );
}

export default AppHeader;
